import React from 'react';
import { useNavigate } from 'react-router-dom';

const companies = ['BMW', 'Triumph', 'Enfield', 'Yamaha', 'Kawasaki']; // 5 brands

function TopBikes() {
  const navigate = useNavigate();

  const handleClick = (brand) => {
    navigate('/', { state: { brand } });
  };

  return (
    <div style={styles.container}>
      {/* Top Picks from Premium Brands section */}
      <h1 style={styles.heading}>Top Picks from Premium Brands</h1>
      <div style={styles.buttonContainer}>
        {companies.map((brand) => (
          <button
            key={brand}
            onClick={() => handleClick(brand)}
            style={styles.button}
          >
            {brand}
          </button>
        ))}
      </div>

      {/* Additional Information Section */}
      <div style={styles.infoContainer}>
        <h2 style={styles.subheading}>More Information</h2>
        <p style={styles.infoText}>Most Expensive Bike</p>
        <p style={styles.infoText}>Fastest Bike</p>
        <p style={styles.infoText}>Oldest Bike</p>
        <p style={styles.infoText}>Most Popular Bike</p>
        {/* Add more as needed */}
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'flex-start', // Move content to the top of the page
    paddingTop: '20px', // Add some padding on top for spacing
  },
  heading: {
    marginBottom: '20px',
    fontSize: '36px',
  },
  buttonContainer: {
    display: 'flex',
    flexDirection: 'row', // Horizontal alignment
    gap: '15px', // Space between buttons
    justifyContent: 'center', // Center the buttons horizontally
    marginBottom: '30px', // Space between the buttons and the info section
  },
  button: {
    padding: '10px 20px',
    fontSize: '18px',
    backgroundColor: '#3498db',
    color: 'white',
    border: 'none',
    borderRadius: '25px',
    cursor: 'pointer',
    width: '200px',
  },
  infoContainer: {
    textAlign: 'center',
    marginTop: '40px', // Space from the button section
  },
  subheading: {
    fontSize: '28px',
    marginBottom: '20px',
  },
  infoText: {
    fontSize: '18px',
    marginBottom: '10px',
  },
};

export default TopBikes;
